import React from 'react';
import styled from 'styled-components';
import SmoothCorners from '../components/common/SmoothCorner';

const CirclesContainer = styled.div``;

const NavButton = () => {
  return (
    <SmoothCorners>
      <CirclesContainer>
        <Circle />
      </CirclesContainer>
    </SmoothCorners>
  );
};

export default NavButton;
